var drawChart;

var ids='';

function drawCharts(id, option){
	
	drawChart = echarts.getInstanceByDom(document.getElementById(id)); 
	if(!drawChart) {
		drawChart = echarts.init(document.getElementById(id));
	}

	drawChart.setOption(option);
	return drawChart;
}

