//柱形图初始化
function getBarDrawOption(options){
	
	var defaults = {
			yTitle:'',
			xTitle:'',
			xDatas: [],
			seriesDatas: [{name:'',data:[],color:'',colorList:[]}],
			changeAxis:false,
			color:'',
			barWidth : 35,
			axisColor:'',
			isAxis:true,
			isshowYAxis:true,
			isLengen:true,
			isAxisTick:true,
			xsplitLineColor:'#f1f1f1',
			ysplitLineColor:'#f1f1f1',
			isSingleTips:false,
			splitLineShow:false,
			rightPadding:"4%",
			topPadding:"30px",
			titleColor:"#f1f1f1",
			barMinHeight:0
	}
	var options = $.extend(true, defaults, options);
	var series = $.map(options.seriesDatas,function(item){  //[{name:"a",value:70,color:"#91c7ae"}]
		return {
			name:item.name,
			type:'bar',
			barWidth : options.barWidth,
			barMinHeight:options.barMinHeight,
			data:item.data,
			stack:item.stack?item.stack:'',
			itemStyle:{
                normal: {
                	color:function(params) {
                        // build a color map as your need.
                		if(typeof(item.colorList)!='undefined'){
                			if(item.colorList.length>0){
                				var colorList = item.colorList;
                				return colorList[params.dataIndex];
                			}else{
                    			return item.color;
                    		}
                		}else{
                			return item.color;
                		}
                    }
                }
            }
		};
	});
	
	var lengendData =[];
	if(options.isLengen){
		lengendData = $.map(options.seriesDatas,function(item){  //[{name:"a",value:70,color:"#91c7ae"}]
			return item.name;
		});
	}
	
	var areaColor='#fff';
	var axisColor = '#000';
	var dataZoomShow = false;
	var gridBottom = '10%';
	if(options.color.length>0){
		areaColor=options.color;
	}
	if(options.axisColor.length>0){
		axisColor=options.axisColor;
	}
	if(options.gridBottom != '10%'){
		gridBottom=options.gridBottom;
	}
	
	var axis = {
			 xAxis: {
				 	name: options.xTitle,
				 	type : 'category',
			    	show:true,
			    	nameTextStyle:{
		            	color:options.titleColor
		            },
			    	axisLabel:{
			    		interval:0,
			    		rotate: options.rotate,
			    		textStyle:{
		                	color: axisColor
		                }
			    	},
			    	splitLine: {  
		            	lineStyle: {
		            		color: options.xsplitLineColor
		            	}
		            },
		            axisTick: {
		            	show:options.isAxisTick,
		                lineStyle: {
		                    color: '#f1f1f1'
		                }
		            },
		            axisLine: {
		                lineStyle: {
		                    color: options.xsplitLineColor
		                }
		            },
			    	splitLine: {  
			    		show:options.splitLineShow,
			    		lineStyle: {
		            		color: options.ysplitLineColor
		            	}
			    	},
			        data: options.xDatas
			    },
			    yAxis: {
			    	name: options.yTitle,
			    	show:true,
			        type: 'value',
		            nameTextStyle:{
		            	color:options.titleColor
		            },
		            splitArea:{
		            	show:true,
		            	areaStyle:{
		            		color:areaColor
		            	}
		            },
		            splitLine: {  
		            	lineStyle: {
		            		color: options.ysplitLineColor
		            	}
		            },
		            axisTick: {
		            	show:options.isAxisTick,
		                lineStyle: {
		                    color: '#bfbfbf'
		                }
		            },
		            axisLine: {
		            	lineStyle: {
		                    color: options.xsplitLineColor
		                }
		            },
		            axisLabel:{
		            	textStyle:{
		            		fontWeight:'lighter',
			                	color: axisColor
		            	}
		            }
			    }
	}
	if(options.changeAxis){
		var tmp = axis.xAxis
		axis.xAxis = axis.yAxis;
		axis.yAxis = tmp;
	}
	
	if(!options.isAxis){
		axis.xAxis.show = false;
	}
	
	var option = {
			title: {
			        text: '',
			        x: 'center'
			    },
			tooltip : {
			        trigger: 'axis',
			        axisPointer : {            
			            type : 'shadow'        
			        },
			        formatter: function(params, ticket, callback) {
			        	if(options.isSingleTips){
			        		for(var i=0;i<params.length;i++){
	                        	if(params[i].data!='-'){
	                           	 return params[i].seriesName+" : " +params[i].data;
	                           }
	                        }
			        	}else{
			        		var str = '';
			        		for(var i=0;i<params.length;i++){
			        			str+= params[i].seriesName==''?params[i].data +"</br>":params[i].seriesName+" : " +params[i].data +"</br>";
	                        }
			        		return str;
			        	}
                    }
			},
			legend: {
				 data: lengendData,
				    bottom: '-5px',
				    textStyle:{
				    	color:'#b4c0ce'
				    }
//				    selectedMode:false    //设置为不能点击
			},
			grid: {
				top:options.topPadding,
			    left: '10px',
			    right: options.rightPadding,
			    bottom: gridBottom,
			    containLabel: true
			},
		    xAxis: axis.xAxis,
		    yAxis: axis.yAxis,
		    series: series
		};
	if(typeof(options.options) != 'undefined'){
		$.extend(option, options.options);
	}
	
	if(options.dataZoomShow){
		option.dataZoom = [{
							   type:'slider',
			                   show: true,
			                   startValue: 1,
			                   endValue: 6,
			                   zoomLock: true
			               }];
	}
	
	return option;
}
//饼图参数初始化
function getPIEDrawOption(options){
	var defaults = {
			seriesDatas: [
			 		        {
			 		        	value: 0, 
								name: '',
								color:''
							}
					    ],
		    isLableData:false
	}
	var options = $.extend(true, defaults, options);
	var fontSize=30;
	var radius = '55%';
	if(options.isLength){
		legendDatas=[];
	}
	if(options.fontSize){
		fontSize=options.fontSize
	}
	if(options.pieRadius){
		radius = options.pieRadius;
	}
	if(options.noLegend){
		var legendDatas=[];
	}else{
		var legendDatas = $.map(options.seriesDatas,function(item){ 
			return {
				name:item.name,
				value:item.value
			};
		});
	}
	var seriesDatas = $.map(options.seriesDatas,function(item){ 
		return {   
    		value : item.value,
            legendHoverLink:true,
            hoverAnimation:true,
            name:item.name,
            itemStyle:{
                normal: {
                	color:item.color 
                }
            }
        }
	});
	var formatter = function (name) {
        return name;
    };
    var orient = 'vertical';
    var center = ['50%','50%'];
    if(options.isLableData){
    	formatter = function (name) {
            var value;
            for(var i=0;i<seriesDatas.length;i++){
                if(seriesDatas[i].name == name){value = seriesDatas[i].value}
            }
            return name +":" +value;
        };
        orient = 'horizontal';
        center = ['18%', '60%'];
    }
    
    var legendX = 'left',legendY='top';
    if(options.legendX){
    	legendX = options.legendX;
    }
    if(options.legendY){
    	legendY = options.legendY;
    }
    if(options.orient){
    	orient = options.orient;
    }
    if(options.center){
    	center = options.center;
    }
	var option = {
		    tooltip: {
		        trigger: 'item',
		        formatter: "{b}: {c}个 ({d}%)"
		    },
			legend: {
		        orient: orient,
		        x:legendX,
		        y:legendY,
		        data:legendDatas,
		        formatter: formatter,
		        textStyle:{
		        	color:options.legendColor?options.legendColor:'#000'
		        }
		    },
		    series: [
		        {
		            type:'pie',
		            radius: radius,
		            center: center,
		            avoidLabelOverlap: false,
		           /* label: {
		                normal: {
		                    show: false,
		                    position: 'center'
		                }
		            },*/
		            label: {//饼图图形上的文本标签，可用于说明图形的一些数据信息
		                normal: {
		                	//标签内容格式器,模板变量有 {a}、{b}、{c}、{d}，分别表示系列名，数据名，数据值，百分比。
		                	show: false,
		                    formatter: '{d}%',
		                    position: 'center',//标签的位置
		                    textStyle:{
		                        fontSize:fontSize
		                    }
		                },
		                emphasis:{
		                	show: false
		                }
		            },
		            labelLine: {
		                normal: {
		                    show: false
		                }
		            },
		            data:seriesDatas
		        }
		    ]
		};
	return option;
	
};

